import styled from 'styled-components'

export const Container = styled.div`

  max-width: 480px;
  margin: 0 auto;
  padding: 2rem 0;
  text-align: center;

  img {
    padding: 1rem 0;
  }

  h2 {
    font-weight: normal;
    font-size: 1.75rem;
  }

`
